resources.description:
Use this endpoint to get information from a specific user. Enter the user ID in the URL. You need to pass the access token in the header of this request.

Parameters:
<br /><pre>[user_id] = required | integer</pre>

CURL example:
<pre>curl --request GET \
  --url /api/users/16 \
  --header 'Authorization: Bearer $access_token' \
  --header 'Content-Type: application/x-www-form-urlencoded'</pre>

Example of successful return:

<pre>{
  "error": false,
  "message": "User data returned successfully!",
  "data": {
    "users": [
      {
        "id": 16,
        "email": "example@example.com",
        "name": "Example Name",
        "date_of_birth": "1985-03-15",
        "active": true
      }
    ]
  }
}</pre>

Example of return with error:

<pre>{
  "error": false,
  "message": "No users returned!",
  "data": {
    "users": []
  }
}</pre>

Use this endpoint to add a user.

Parameters:
<br />
<pre>[email] = required | string
[name] = required | string
[password] = required | string | min 8 char, 1 number, 1 upper char
[date_of_birth] = required | string | format Y-m-d</pre>

CURL example:
<pre>curl --request POST \
  --url /api/users/ \
  --header 'Accept: application/json' \
  --header 'Content-Type: application/x-www-form-urlencoded' \
  --data email=example@example.com \
  --data 'name=Example Name' \
  --data password=SomePassword01 \
  --data date_of_birth=1985-03-15</pre>

Example of successful return:

<pre>{
  "error": false,
  "message": "User added successfully!",
  "data": {
    "user": {
      "id": 16,
      "email": "example@example.com",
      "name": "Example Name",
      "date_of_birth": "1985-03-15",
      "active": true
    }
  }
}</pre>

Example of return with error. Validation errors contain the name of the field and the message:

<pre>{
  "error": true,
  "message": "Error adding the User!",
  "data": {
    "validations": {
      "name": [
        "The name field is required."
      ],
      "password": [
        "The password field is required."
      ],
      "date_of_birth": [
        "The date of birth field is required."
      ]
    }
  }
}</pre>

Use this endpoint to get information from a specific book. Enter the book ID in the URL.

Parameters:
<pre>[book_id] = required | integer</pre>

CURL example:
<pre>curl --request GET \
  --url /api/books/4 \
  --header 'Content-Type: application/x-www-form-urlencoded'</pre>

Example of successful return:

<pre>{
  "error": false,
  "message": "Book data returned successfully!",
  "data": {
    "books": [
      {
        "id": 4,
        "title": "Unde sed.",
        "isbn": "0593139135",
        "published_at": "2005-04-10",
        "status": "AVAILABLE",
        "active": true
      }
    ]
  }
}</pre>

Example of return with error:

<pre>{
  "error": false,
  "message": "No books returned!",
  "data": {
    "books": []
  }
}</pre>

Use this endpoint to add a book. You need to pass the access token in the header of this request.

Parameters:
<pre>[title] = required | string
[isbn] = required | string | valid 10-digit ISBN
[published_at] = required | string | format Y-m-d</pre>

CURL example:
<pre>curl --request POST \
  --url /api/books/ \
  --header 'Accept: application/json' \
  --header 'Authorization: Bearer $access_token' \
  --header 'Content-Type: application/x-www-form-urlencoded' \
  --data 'title=Harry Potter' \
  --data isbn=8532512941 \
  --data published_at=2019-01-01</pre>

Example of successful return:

<pre>{
  "error": false,
  "message": "Book added successfully!",
  "data": {
    "book": {
      "id": 34,
      "title": "Harry Potter",
      "isbn": "8532512941",
      "published_at": "2019-01-01",
      "status": "AVAILABLE",
      "active": true
    }
  }
}</pre>

Example of return with error. Validation errors contain the name of the field and the message:

<pre>{
  "error": true,
  "message": "Error adding the Book!",
  "data": {
    "validations": {
      "isbn": [
        "The isbn field is required."
      ],
      "published_at": [
        "The published at field is required."
      ]
    }
  }
}</pre>

Use this endpoint to edit a book. Enter the book ID in the URL. You need to pass the access token in the header of this request.

Parameters:
<pre>[book_id] = required | integer
[title] = string
[isbn] = string | valid 10-digit ISBN
[published_at] = string | format Y-m-d</pre>

CURL example:
<pre>curl --request PUT \
  --url /api/books/1 \
  --header 'Accept: application/json' \
  --header 'Authorization: Bearer $access_token' \
  --header 'Content-Type: application/x-www-form-urlencoded' \
  --data 'title=Harry Potter 2' \
  --data isbn=1594569940 \
  --data published_at=2018-01-02</pre>

Example of successful return:

<pre>{
  "error": false,
  "message": "Book edited successfully!",
  "data": {
    "book": {
      "id": 1,
      "title": "Dolores error numquam quam omnis.",
      "isbn": "1564161447",
      "published_at": "2018-01-02",
      "status": "AVAILABLE",
      "active": true
    }
  }
}</pre>

Example of return with error. Validation errors contain the name of the field and the message:

<pre>{
  "error": true,
  "message": "Error editing the Book!",
  "data": {
    "validations": {
      "isbn": "Invalid ISBN number!"
    }
  }
}</pre>

